import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <form>
          <h1>Hello</h1>
          <p>Enter :</p>
          <input type="text" />
        </form>
      </header>
    </div>
  );
}

export default App;
